import React from "react";

const Level = () => {
  return (
    <svg width="200" height="200">
      <circle
        class="outer"
        cx="95"
        cy="95"
        r="85"
        transform="rotate(-90, 95, 95)"
      />
    </svg>
  );
};

export default Level;
